import React from 'react';
import './footer.css';

const Footer = () => (
  <div className="temple__footer section__padding">
    <div className="temple__footer-heading">
      <h1 className="gradient__text">
        <h5>Contact Us-:</h5>
        <h5>Address: Girnar Gujarat</h5>
        <h5>Phone No.-: 91-XXXXXXXXXX</h5>
        <h5>Email ID-: info@payme.net</h5>
        </h1>
    </div>
    <div className="temple__footer-copyright">
      <p>@2024 Somnath Temple Ticketing System. All rights reserved.</p>
    </div>
  </div>
);

export default Footer;
